import React, {useEffect, useState} from 'react';
import RecipieCard from './RecipieCard';
import axios from "axios";

const client = axios.create({
  baseURL: "http://localhost:5000" 
});


function RecipieList() {
    const [recipies1, setRecipies1] = useState(null);

    useEffect(() => {
        client.get('/').then((response) => {
            setRecipies1(response.data);
        });
    }, []);

    console.log(recipies1);

    if (recipies1 === null) {
        return (<h1>Loading...</h1>)
    } else {
        return (
            <div className='row'>
                {recipies1.map((currentRecipie, index) => {
                    return (<RecipieCard id={index} key={index} title={currentRecipie.recipieTitle} prevText={currentRecipie.recipiePrevDescription} imgSource={currentRecipie.recipiePrevImage.path}  />)
                })}
            </div>
        )
    }
}

export default RecipieList;
